import React from "react";
import ActivityTracker from "./ActivityTracker";
import YogaMeditation from "./YogaMeditation";
import AppointmentScheduler from "./AppointmentScheduler";
import ChatWithTherapist from "./ChatWithTherapist";
import MedicationReminder from "./MedicationReminder";
import ProgressDashboard from "./ProgressDashboard";
import DailyJournal from "./DailyJournal";
import EducationalResources from "./EducationalResources";

const Dashboard = () => {
  return (
    <div
      className="container-fluid py-4"
      style={{
        backgroundImage:
          "url('https://images.unsplash.com/photo-1506748686214-e9df14d4d9d0?blur=10&crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1920')",
        backgroundSize: "cover",
        backgroundPosition: "center",
        minHeight: "100vh",
      }}
    >
      <h2 className="text-center text-white fw-bold mb-4">Patient Dashboard</h2>
      <div className="row g-4">
        <div className="col-lg-4 col-md-6">
          <ActivityTracker />
        </div>
        <div className="col-lg-4 col-md-6">
          <YogaMeditation />
        </div>
        <div className="col-lg-4 col-md-6">
          <AppointmentScheduler />
        </div>
        <div className="col-lg-4 col-md-6">
          <ChatWithTherapist />
        </div>
        <div className="col-lg-4 col-md-6">
          <MedicationReminder />
        </div>
        <div className="col-lg-4 col-md-6">
          <ProgressDashboard />
        </div>
        <div className="col-lg-4 col-md-6">
          <DailyJournal />
        </div>
        <div className="col-lg-4 col-md-6">
          <EducationalResources />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
